import styled from "styled-components";

export const Wrap = styled.div`
    padding: 30px 0;
`;

export const Title = styled.div`
  font-size: 32px;
  text-align: center;
  padding: 40px 0;
  font-family: "Sofia Pro";
  font-weight: 600;
`;
